import './App.css';
import { useState, useEffect } from 'react'
import {getTodos} from '../components/getRequests.js'
import {BrowserRouter as Router, Routes, Route } from 'react-router-dom'

function App() {
  const [todos, setTodos] = useState([])

  useEffect(() => {
    getTodos()
    .then(res => setTodos(res.json()))
}, [])

  return (
    <div className="App">
    <Router >
      <Routes>
        <Route path="/"/>
      </Routes>
    </Router>
    </div>
  );
}

export default App;
